Insane Pools: Off the Deep End 
There are custom pools and gardens - and then there are Lucas Lagoons. Animal Planet's new series, Insane Pools: Off The Deep End, follows award-winning pool designer Lucas Congdon as he turns high and dry homes into exotic waterfront properties through grand, nature-inspired designs to encourage his clients to rediscover their love of the outdoors.


1)  Swimming with the Fishes 
The Lucas Lagoons crew turns a koi pond project into a backyard oasis for a family and their fish in Siesta Key. The team transforms an old, outdated pool into a natural lagoon, connecting it to the new pond and installing an amazing aquaponics system.

2)  Paradise on the Bay 
A bay-side paradise is created for a couple on Florida's Gulf Coast, but Lucas finds a new challenge in building an outdoor living space, pool, spa, fireplace and kitchen without any of his signature rockwork.

3)  Mountain Lodge Oasis 
The Lucas Lagoons crew faces the unique challenge of building a Rocky Mountain-style lagoon for a family living in the Florida wetlands. Lucas quickly learns his clients will be supervising him along the way as he creates the pool of their dreams.

4)  In Hot Water 
After ten years of saving and dreaming for a pool, a couple wants Lucas to build the wow factor. The crew creates a giant double-pool feature with a connecting stream and several customized surprises to deliver the &quot;wow&quot; and dismiss any doubt.

5)  Growing Pains 
A couple with a baby wants Lucas to remodel their dangerously outdated pool and make it safe for their son. The goal is to preserve the pool's cage while swinging in massive rocks to transform a dull patio pool into a stunning natural atrium.

6)  Green with Envy 
Lucas and the crew build a Caribbean destination in a landlocked backyard. It's a clash of wills, as the clients demand that a reluctant Lucas use some green rocks to create a tropical oasis with a sand bottom, salt-water pool loaded with features.

